- input: "TEXT\x1CC00540377\x1C.TEXT\x1C\x1CF3A\x1CAmended report reflects various
    adjustments/corrections carried over from an amendment to the Committee's Pre-Special
    Primary Report on April 18, 2013. PLEASE NOTE:  Per receipt of a letter from the
    FEC's Reports and Analysis Division dated April 16, 2013, in order to further
    address missing donor occupation/employer data for contributions reported in the
    Pre-Special Primary Report the Committee is issuing additional requests for information
    to donors from whom the Committee has thus far been unable to secure occupation/employer
    data (despite providing notices regarding the Committee's obligation and efforts
    to collect this information to donors in a number of forms, including orally,
    via written correspondence, on the campaign's website, and upon contribution forms
    provided to many donors). In conjunction with these efforts, the Committee shall
    make additional attempts to collect such data in the instances it is missing from
    donor records presented in this report; where possible, such data shall be presented
    in a forthcoming amendment to this report.\n"
